/* import styled from "styled-components"; */
import styles from './layout.module.scss'


const Layout = ({ children }) => {
  return <div className={styles.container}>{children}</div>;
};

/* const Container = styled.div`
  color: #333;
  background: yellow;
`; */

export default Layout;
